INSERT INTO `synonyms` VALUES (1,1,1,'glow','he town\'s lights cast a glow on the horizon.',' having a relatively small amount of coloring agent'),(1,2,2,'burn','The hot sun burned her skin.',' cause to start burning; subject to fire or great heat'),(1,3,3,'bright','The lighting was too bright.','having lots of light either natural or artificial'),(2,1,1,'fasting','  I was hospitalised after three days of fasting.','abstaining from food'),(2,2,2,'swift','The police took swift action against the rioters.','acting or moving or capable of acting or moving quickly'),(2,3,3,'quick','They had a quick drink at the bar.','hurried and brief'),(2,4,4,'quickly','We\'ll repair it as quickly as possible.','hurried and brief'),(3,1,1,'progress','The project showed slow but steady progress.','a movement forward'),(3,2,2,'proceed','We will proceed according to plan.','the act of moving forward (as toward a goal)'),(3,3,3,'leading','He is a leading authority in his field.','having the leading position or higher score in a contest'),(4,1,1,'null','He said that he had shot 13 tigers and 28 leopards.',' endangered'),(5,1,1,'null','He\'s quite a cheeky little monkey.','one who is playfully mischievous');
